                <div class="w-[55%] pb-8">
                    <div class="w-[130px] border-y border-[#E1B168] text-center mb-3">
                        <h1 class="pt-1 tracking-[3px]">ABOUT US</h1>
                    </div>
                    <h1 class="mb-4 text-4xl" style="font-family: 'Cormorant Infant';">Quality and  Tradition</h1>
                    <p class="w-[82%]">Ayayo Bandung's Grilled Duck is a mouthwatering Indonesian culinary delight that will tantalize your taste buds with its exquisite flavors and textures. This dish features succulent duck, marinated in a medley of aromatic spices, herbs, and seasonings, creating a harmonious fusion of sweet, savory, and slightly spicy flavors. The duck is expertly grilled to perfection, imparting a smoky and charred essence to the tender meat.</p>
                    <br>
                    <p class="w-[82%]">Served with a side of steamed rice and traditional Indonesian sambal, Ayayo Bandung's Grilled Duck offers a delightful balance of flavors and textures. The sambal, made from a blend of chilies, shallots, and various ingredients, adds a zesty and fiery kick to the dish, complementing the richness of the duck.</p>
                    <br>
                    <p class="w-[82%]">This delectable dish not only captures the essence of Indonesian cuisine but also showcases the culinary expertise of Ayayo Bandung, making it a must-try for food enthusiasts looking to savor the unique and savory flavors of grilled duck in Bandung.</p>

